/**
 * @param {number[]} costs
 * @param {number} k
 * @param {number} candidates
 * @return {number}
 */

const Heap = require('./../../datastructure/Heap').Heap;


 var totalCost2 = function(costs, k, candidates) {
    let totalCost = 0

    let i = 0, j = costs.length - 1
    let leftHeap = new Heap([], (a, b) => b - a)
    let rightHeap = new Heap([], (a, b) => b - a)

    while(k > 0){
        while(leftHeap.size() < candidates && i <= j){
            leftHeap.add(costs[i++])
        }

        while(rightHeap.size() < candidates && i <= j){
            rightHeap.add(costs[j--])
        }

        let leftMin = leftHeap.size() > 0 ? leftHeap.peek() : 1000000
        let rightMin = rightHeap.size() > 0 ? rightHeap.peek() : 1000000
        if(leftMin <= rightMin){
            totalCost += leftMin
            leftHeap.poll()
        }
        else{
            totalCost += rightMin
            rightHeap.poll()
        }
        k--
    }
    return totalCost
};

// version1: time limit exceeded
 var totalCost = function(costs, k, candidates) {
    let totalCost = 0

    for (let i = 0; i < k; i++) {
        if(costs.length <= candidates * 2){
            const minIndex = getMinIndex(costs, 0, costs.length - 1)

            totalCost += costs[minIndex]
            costs.splice(minIndex, 1)
        }
        else{
            const startMinIndex = getMinIndex(costs, 0, candidates - 1)
            const endMinIndex = getMinIndex(costs, costs.length - candidates, costs.length - 1) 
            
            const realMinIndex = costs[startMinIndex] <= costs[endMinIndex] ? startMinIndex : endMinIndex
            totalCost += costs[realMinIndex]
            costs.splice(realMinIndex, 1)
        }
    }

    return totalCost
};

function getMinIndex(array, start, end){ //[start, end]
    let min = array[start]
    let minIndex = start
    for (let i = start + 1; i <= end; i++) {
        if(array[i] < min){
            min = array[i]
            minIndex = i
        }
    }

    return minIndex
}

console.log(totalCost2([17,12,10,2,7,2,11,20,8], 3, 4))

console.log(totalCost2([1,2,4,1], 3, 3))

